  return (
    <>
    <MenuDoador/>
    <div class="div-campanhas">    
    {
            musicas.map((itemMusica) => (
              <CardMusica nomeMusica={itemMusica.nome}
                          artista={itemMusica.artista}
                          categoria={itemMusica.genero}
                          anoMusica={itemMusica.ano}
                          capa={itemMusica.capa}/>
            ))
          }           
              <CardCampanhaDoador nome={CardCampanhaDoador.nome}
                                  descricao={CardCampanhaDoador.descricao}
                                  valorCampanha={CardCampanhaDoador.valorCampanha}/>
    </div>
    </>
  );
}

export default CampanhasDoador;
